INSERT INTO `catalog_pages` VALUES (1,-1,'frontpage','Inicio',1,213,'1','1',1,'0',0,'frontpage_featured','','','','Bem vindo ao Catálogo do Mania Hotel','','','','0','',0),(2,-1,'furniture','Mobis',1,42,'1','1',1,'0',1,'pets2','','furni_by_item_teaser','','Para saber mais sobre o funcionamento do catálogo e começar a construção no Mania Hotel, leia atentamente as seguintes explicações.','Um, dois ou três truques:','\r\n- Para decorar seu apartamento, basta comprar o mobiliário que deseja e recuperá-lo em seu inventário e depois colocá-lo em seu apartamento.\r\n\r\n- Procure móveis de acordo com seu nome na barra de pesquisa, exemplo: cadeira.\r\n\r\n- O mobiliário pode então ser colocado com a ajuda de setz e controles embutidos.\r\n\r\n- Os animais e os bots também aparecem no inventário, mas na categoria de Bot (s) ou Animais e bebês.','Em caso de dúvida, não hesite em contactar o suporte em nosso site.','0','',0),(3,-1,'pets','Mascotes',1,8,'1','1',1,'0',4,'info_pets','catalog_pet_headline2_uk','ctlg_pet_teaser1','','','','How to take care of your pets:<br/>\r\n- Just feed it</br>\r\n- Play with it</br>\r\n- Tell it to shut up<br/>','','0','',0),(4,-1,'utilitarios','Utilitários',1,1,'1','1',1,'0',2,'default_3x3','','','','','','','','0','',0),(5,-1,'staff','Staff',1,1,'1','1',5,'0',5,'default_3x3','','','','','','','','0','',0),(6,198,'iced','Iced',1,72,'1','1',1,'0',36,'default_3x3','catalog_iced_headline1','catalog_iced_teaser1','','A gama de gelo, suave, macia e definitivamente calma. Seja qual for sua necessidade, essa gama elegante deve cobri-la!','',' ','','0','',0),(7,198,'mode','Mode',1,39,'1','1',1,'0',47,'default_3x3','catalog_mode_headline1','catalog_mode_teaser1','catalog_special_txtbg2','Cinzento e cinza padrão industrial padrão com um design elegante. A gama perfeita para um morador da cidade tranqüila.','',' ','Tão brilhante e novo...','0','',0),(8,198,'area','Area',1,14,'1','1',1,'0',5,'default_3x3','catalog_area_headline1','catalog_area_teaser1',