nam como obstáculos e ajudantes!','0','',0),(258,246,'freeze_tutorial','Como jogar Freeze!',1,42,'1','1',1,'0',0,'pets2','catalog_freeze_en','Catalog_teaser_freeze','','Descubra como você pode criar e hospedar seu próprio jogo Freeze, lendo as instruções abaixo!','Como criar o seu próprio Freeze Arena:','1. Coloque telhas e blocos no seu quarto. Coloque sempre blocos em cima de telhas!\r\n\r\n2. Adicione Team Gates, um Counter, um Exit Tile e Scoreboards.\r\n\r\n3. Pronta? Deixe seus amigos escolherem uma equipe. Cada equipe pode ter até cinco jogadores. Em seguida, clique no Contador para começar!\r\n\r\n4. Para colocar uma bola de neve, clique duas vezes no azulejo em que você está parado, ou clique duas vezes em uma tela ao seu lado. Blow up Blocks para power-ups!\r\n\r\n5. O último time em pé ganha!','Lembre-se: você será enrolado em uma telha de saída quando perder todas as suas vidas.','0','',0),(259,2,'marketplace','Feira Livre',1,69,'1','1',1,'0',15,'pets2','catalog_marketplace_header_en','catalog_note_marketplace','','O Mercado do Mania Hotel é uma maneira conveniente e segura de comprar e vender mobilias no jogo.','Como o mercado funciona:','- Você coloca um item à venda.\r\n\r\n- Uma vez vendido, você pode reivindicar seus créditos.\r\n\r\n- Quando você compra um item, sempre o mais barato vendido é comprado!\r\n\r\n- Verifique um histórico de itens para ver o que vai e quando é um bom momento para comprar!','','0','',0),(260,259,'marketplace_items','Ofertas',1,71,'1','1',1,'0',0,'marketplace','catalog_marketplace_header_en','','','','','','','0','',0),(261,259,'marketplace_own_items','Minhas vendas',1,70,'1','1',1,'0',0,'marketplace_own_items','catalog_marketplace_header_en','','','','','','','0','',0),(373,5,'crafting','Crafting',1,1337,'1','1',5,'0',3,'default_3x3','rares','','','','','','','0','',0),(263,288,'santorini','Santorini',1,55575,'1','1',1,'0',9,'default_3x3','','','','','','','','0','',0),(264,288,'modern','Moderno',1,55577,'1','1',1,'0',5,