INSERT INTO `hotelview_news` VALUES (1,'Discord','Tá afim de ficar sabendo em primeira mão as novidades do Mania? Então se liga só!<br><br>Como todos sabem, desde o início o Mania visa a importância dos users e a participação dos mesmos para a melhoria do Hotel. Pensando nisso, estaremos disponibilizando um server online para os usuários, onde poderão opinar, dar sugestões, ficar de olho nas novidades, tirar dúvidas com Staffs e interagir com eles e com outros usuários.<br><br>Curtiu a ideia? Então é só entrar no nosso Discord.','Clique aqui','web','https://discord.gg/WNWSJCa','web_promo_small/discord.png');
/*!40000 ALTER TABLE `hotelview_news` ENABLE KEYS */;
UNLOCK TABLES;

