INSERT INTO `navigator_filter` VALUES ('owner','getOwnerName','equals_ignore_case','SELECT * FROM rooms WHERE owner_name LIKE ?'),('anything','filterAnything','contains','SELECT rooms.*, CONCAT_WS(rooms.owner_name, rooms.name, rooms.description, rooms.tags, guilds.name, guilds.description) as whole FROM rooms LEFT JOIN guilds ON rooms.guild_id = guilds.id HAVING whole LIKE ? '),('roomname','getName','contains','SELECT * FROM rooms WHERE name COLLATE UTF8_GENERAL_CI LIKE ? '),('tag','getTags','equals','SELECT * FROM rooms WHERE tags LIKE ?'),('group','getGuildName','contains','SELECT rooms.* FROM guilds INNER JOIN rooms ON guilds.room_id = rooms.id WHERE CONCAT(guilds.name, guilds.description) LIKE ?'),('desc','getDescription','contains','SELECT * FROM rooms WHERE description LIKE ?'),('promo','getPromotionDesc','contains','SELECT rooms.* FROM rooms INNER JOIN room_promotions ON rooms.id = room_promotions.id WHERE room_promotions.end_timestamp >= UNIX_TIMESTAMP() AND CONCAT (room_promotions.title, room_promotions.description) LIKE ?');
/*!40000 ALTER TABLE `navigator_filter` ENABLE KEYS */;
